import React, { Component } from 'react'
import { Layout } from 'antd'

const { Content, Footer } = Layout

export class Index extends Component {
  render () {
    return (
      <Layout>
        <Content style={{ margin: '24px 16px 0' }}>
          <div>home</div>
        </Content>
      </Layout>
    )
  }
}

export default Index
